import React, { Component } from 'react';
class SignUp extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            Username:'',
            Password:'',
            DOB:'',
            Gender:'',
            Number:'',
            message:''
         }
    }
    render() { 
        return ( 
            <div>
                <p>Username : <input value={this.state.Username} placeholder='Username' onChange={e=>this.user(e)} /> </p>
                <p>Password : <input value={this.state.Username} placeholder='Pxyz@123' onChange={e=>this.user(e)} /> </p>
                <p>  DOB      : <input value={this.state.Username} placeholder='xx/xx/20xx' onChange={e=>this.user(e)} /> </p>
                <p>Ph.Number: <input value={this.state.Username} placeholder='xxxxxxxxxx' onChange={e=>this.user(e)} /> </p>

            </div>
         );
    }
}

export default SignUp;
